script: |
  super -f text -I q13581.spq | sort > q13581.out

inputs:
  - name: q13581.spq
    data: |
      SELECT ALL ( col1 ) + - col0 FROM tab0 (FORMAT parquet) WHERE NOT col0 + - col0 BETWEEN + col0 + 12 AND + 32 * - col0 / 73;
  - name: tab0

outputs:
  - name: q13581.out
    data: |
      -66
      -96
      66
